import React, { useState, useEffect } from "react";
import { Button, Dropdown } from "react-bootstrap";
// We import bootstrap to make our application look better.
import "./navbar.css";
import "bootstrap/dist/css/bootstrap.css";

import { FiSun, FiMoon } from "react-icons/fi";

import logo from "./icons/default-user-icon.jpg";

// We import NavLink to utilize the react router.
import { NavLink } from "react-router-dom";

// Here, we display our Navbar
const Navbar = () => {
    const [dark, setDark] = useState(false);
    const [show, handleShow] = useState(false);

    // useEffect(() => {
    //     window.addEventListener("scroll", () => {
    //         if (window.scrollY > 100) {
    //             handleShow(true);
    //         } else handleShow(false);
    //     });
    //     return () => {
    //         window.removeEventListener("scroll");
    //     };
    // }, []);

    const darkToggler = () => {
        dark ? setDark(false) : setDark(true);
    };

    return (
        <div>
            <nav id={`${dark ? "dark" : "light"}`} className="navbar">
                <NavLink id={`${dark ? "dark" : "light"}`} className="nav-brand" to="/">
                    ELSITO
                </NavLink>

                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav ml-auto">
                        <li className="nav-item">
                            <NavLink className="nav-link" to="/create">
                                Create Record
                            </NavLink>
                        </li>
                    </ul>
                </div>
                <Button className="hidden" onClick={() => darkToggler()}>
                    {dark ? (
                        <FiSun size={30} className="Themer" />
                    ) : (
                        <FiMoon size={30} color="black" />
                    )}
                </Button>

                <Dropdown className="hidden">
                    <Dropdown.Toggle
                        variant="light"
                        className="bg-white border-0 p-0"
                        id="dropdown-basic"
                    >
                        <img src={logo} id="UserLogo" alt="text" />
                    </Dropdown.Toggle>
                    <Dropdown.Menu flip={false} align="end" className="usermenu">
                        <Dropdown.Item href="#/action-2">Account Settings</Dropdown.Item>
                        <Dropdown.Item href="#/action-3">Sign out</Dropdown.Item>
                    </Dropdown.Menu>
                </Dropdown>
            </nav>
            <nav>My Circuits</nav>
        </div>
    );
};

export default Navbar;
